const SummaryBox = () => {
    return ( 
        <>
            <div className="container">
                <div className="col">
                    <p>Trip Type</p>
                    <select name="tripType" className="form-select">
                        <option value="oneWay">One way</option>
                        <option value="roundTrip">Round trip</option>
                    </select>
                </div>
            </div>
        </>
     );
}
 
export default SummaryBox;
